<?php

namespace App\Controller;

use App\Entity\ContenuImg;
use App\Entity\Formation;
use App\Form\FormationType;
use Symfony\Bundle\FrameworkBundle\Controller\AbstractController;
use Symfony\Component\HttpFoundation\Request;
use Symfony\Component\HttpFoundation\Response;
use Symfony\Component\Routing\Annotation\Route;
use App\Entity\Contenutext;

/**
 * @Route("/formation")
 */
class FormationController extends AbstractController
{
    /**
     * @Route("/", name="formation_index", methods="GET")
     */
    public function index(): Response
    {
        $formations = $this->getDoctrine()
            ->getRepository(Formation::class)
            ->findAll();

        return $this->render('formation/index.html.twig', ['formations' => $formations]);
    }

    /**
     * @Route("/new", name="formation_new", methods="GET|POST")
     */
    public function new(Request $request): Response
    {

        return $this->render('formation/new.html.twig');
    }

    /**
     * @Route("/add",name="formation_add", methods="GET|POST")
     */
    public function add(Request $request){


        $formation = new Formation();
        $formation->setDescription($request->get('description'));
        $formation->setNombreDeLessons($request->get('nombre_de_lessons'));
        $formation->setNomFormation($request->get('nomformation'));
        $formation->setTags($request->get('tags'));
        $formation->setVersion($request->get('version'));
        $formation->setDateUpdate(new \DateTime('now'));
        $formation->setDateDePublication(new \DateTime('now'));
        $formation->setNombreDeVue(0);
        $formation->setDisplayPourUser('1');
        $formation->setIsvalide('1');
        $text = new Contenutext();
        $text->setText($request->get('text'));
        $text->setTitre($request->get('titre'));
        $img = new ContenuImg();
        $img->setNameImage('formation');
        $img->setUrlImage('data:image/jpeg;base64,');
        $formation->getContenutext()->add($text);
        $formation->getContenuImg()->add($img);
        // on recuper le Manager entity
        $em =$this->getDoctrine()->getManager();
        $em->persist($formation);
        $em->persist($text);
        $em->persist($img);
        $em->flush();

        return $this->redirectToRoute('formation_index');

    }

    /**
     * @Route("/{idformation}", name="formation_show", methods="GET")
     */
    public function show(Formation $formation): Response
    {
        return $this->render('formation/show.html.twig', ['formation' => $formation]);
    }

    /**
     * @Route("/{idformation}/edit", name="formation_edit", methods="GET|POST")
     */
    public function edit(Request $request, Formation $formation): Response
    {
        /*$form = $this->createForm(FormationType::class, $formation);
        $form->handleRequest($request);

        if ($form->isSubmitted() && $form->isValid()) {
            $this->getDoctrine()->getManager()->flush();

            return $this->redirectToRoute('formation_edit', ['idformation' => $formation->getIdformation()]);
        }*/

        return $this->render('formation/updateformation.html.twig', [
            'formation' => $formation,
        ]);
    }

    /**
     *
     * @Route("/edit", name="formationedit", methods="GET|POST")
     */

    public function editformation(Request $request){
        $formation = $this->getDoctrine()->getRepository(Formation::class)->find($request->get('id'));

        $formation->setDescription($request->get('description'));
        $formation->setNombreDeLessons($request->get('nombre_de_lessons'));
        $formation->setNomFormation($request->get('nomformation'));
        $formation->setTags($request->get('tags'));
        $formation->setVersion($request->get('version'));
        $formation->setDateUpdate(new \DateTime('now'));
        $text = $this->getDoctrine()->getRepository(Contenutext::class)->find($request->get('idtext'));
        $text->setText($request->get('text'));
        $text->setTitre($request->get('titre'));

        $em =$this->getDoctrine()->getManager();
        $em->persist($formation);
        $em->persist($text);
        $em->flush();

        return $this->redirectToRoute('formation_index');
    }

    /**
     * @Route("/{idformation}", name="formation_delete", methods="DELETE")
     */
    public function delete(Request $request, Formation $formation): Response
    {
        if ($this->isCsrfTokenValid('delete'.$formation->getIdformation(), $request->request->get('_token'))) {
            $em = $this->getDoctrine()->getManager();
            $em->remove($formation);
            $em->flush();
        }

        return $this->redirectToRoute('formation_index');
    }
}
